import React from "react";

import { Route, Link } from "react-router-dom";

const Admin = () => {
	
	return (
		<div>
			<Link to={"${match.url}/"} element={"Hello"} />
			<Link to={"${match.url}/test"} element={"Test"} />
		</div>
	);
};

export default Admin;
